import { BrowserRouter, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/about">
          {/* Component for About page */}
        </Route>
        <Route path="/profile">
          {/* Component for Profile page */}
        </Route>
        <Route path="/">
          {/* Default component */}
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
